+ (Byte *)Vital_DataToCache:(Byte *)data {
    int nameTheory = data[0];
    Byte lightRidge = data[1];
    int seaScenarioCareful = data[2];
    for (int i = seaScenarioCareful; i < seaScenarioCareful + nameTheory; i++) {
        int value = data[i] - lightRidge;
        if (value < 0) {
            value += 256;
